import { View, Text } from 'react-native';

export interface HomeScreenProps {
}

export function HomeScreen (props: HomeScreenProps) {
    return (
      <View>
         <Text>HomeScreen</Text>

         <View>
         <Text>Ho</Text>

        </View>

        <View>
         <Text>Campanha</Text>
        </View>

      </View>
    );
}
